    code: [{"title":"default.tsx","code":"\"use client\";\n\nimport { Button } from \"@/registry/ui/react/button\";\nimport { Label } from \"@/registry/ui/react/label\";\nimport { TextField } from \"@/registry/ui/react/text-field\";\nimport {\n  Dialog,\n  DialogHeader,\n  DialogTitle,\n  DialogDescription,\n  DialogFooter,\n} from \"@/registry/ui/react/dialog\";\n\nexport default function DialogDemo() {\n  const Content = () => (\n    <>\n      <DialogHeader>\n        <DialogTitle>Edit profile</DialogTitle>\n        <DialogDescription>\n          Make changes to your profile here. Click save when you're done.\n        </DialogDescription>\n      </DialogHeader>\n      <div className=\"grid gap-4 py-4\">\n        <div className=\"grid grid-cols-4 items-center gap-4\">\n          <Label htmlFor=\"name\" className=\"text-right\">\n            Name\n          </Label>\n          <TextField\n            id=\"name\"\n            defaultValue=\"Pedro Duarte\"\n            className=\"col-span-3\"\n          />\n        </div>\n        <div className=\"grid grid-cols-4 items-center gap-4\">\n          <Label htmlFor=\"username\" className=\"text-right\">\n            Username\n          </Label>\n          <TextField\n            id=\"username\"\n            defaultValue=\"~peduarte\"\n            className=\"col-span-3\"\n          />\n        </div>\n      </div>\n      <DialogFooter>\n        <Button type=\"submit\">Save changes</Button>\n      </DialogFooter>\n    </>\n  );\n\n  return (\n    <Dialog content={<Content />} className=\"sm:max-w-[425px]\">\n      <Button>Edit Profile</Button>\n    </Dialog>\n  );\n}\n"}]
