    code: [{"title":"side.tsx","code":"\"use client\";\n\nimport { Label } from \"@/registry/ui/react/label\";\nimport { TextField } from \"@/registry/ui/react/text-field\";\nimport { Button } from \"@/registry/ui/react/button\";\nimport {\n  Sheet,\n  SheetHeader,\n  SheetTitle,\n  SheetDescription,\n  SheetFooter,\n  SheetClose,\n} from \"@/registry/ui/react/sheet\";\n\nconst sides = [\"top\", \"right\", \"left\", \"bottom\"] as const;\n\nexport default function SheetDemo() {\n  const Content = () => (\n    <>\n      <SheetHeader>\n        <SheetTitle>Edit profile</SheetTitle>\n        <SheetDescription>\n          Make changes to your profile here. Click save when you're done.\n        </SheetDescription>\n      </SheetHeader>\n      <div className=\"grid gap-4 py-4\">\n        <div className=\"grid grid-cols-4 items-center gap-4\">\n          <Label htmlFor=\"name\" className=\"text-right\">\n            Name\n          </Label>\n          <TextField\n            id=\"name\"\n            defaultValue=\"Pedro Duarte\"\n            className=\"col-span-3\"\n          />\n        </div>\n        <div className=\"grid grid-cols-4 items-center gap-4\">\n          <Label htmlFor=\"username\" className=\"text-right\">\n            Username\n          </Label>\n          <TextField\n            id=\"username\"\n            defaultValue=\"~peduarte\"\n            className=\"col-span-3\"\n          />\n        </div>\n      </div>\n      <SheetFooter>\n        <Button type=\"submit\">Save changes</Button>\n      </SheetFooter>\n    </>\n  );\n\n  return (\n    <div className=\"grid grid-cols-2 gap-2\">\n      {sides.map((side) => (\n        <Sheet key={side} content={<Content />} side={side}>\n          <Button>{side}</Button>\n        </Sheet>\n      ))}\n    </div>\n  );\n}\n"}]
